import React from 'react';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableCell';


function Customer(props){
    return (
        // <div>
        //     <CustomerProfile id={props.id} src={props.src} name={props.name}/ >
        //     <CustomerInfo birthday={props.birthday} gender={props.gender} job={props.job}/ >
        // </div>
        <TableRow>
            <TabelCell>{props.id}</TabelCell>
            <TabelCell><img src={props.src} alt="profile image"/></TabelCell>
            <TabelCell>{props.name}</TabelCell>
            <TabelCell>{props.birthday}</TabelCell>
            <TabelCell>{props.gender}</TabelCell>
            <TabelCell>{props.job}</TabelCell>
        </TableRow>
    )
}

function CustomerProfile(props){
    return(
        <div>
            <img src={props.src} alt="profile image"/>
            <p>{props.name} [{props.id}]</p>
        </div>
    )
}

function CustomerInfo(props){
    return(
        <div>
            <p>{props.birthday}</p>
            <p>{props.gender}</p>
            <p>{props.job}</p>
        </div>
    )
}
export default Customer;
